import React from "react";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
      <a className="navbar-brand" href="/">
        Personal Catalog
      </a>

      <button type="button" class="btn btn-outline-dark">Login with </button>
    </nav>
  );
}

export default Nav;
